description:
SUBARU OUTBACK, ограниченная серия Deep Cherry Edition
Один собственник. Покупался в Новосибирске в Premium Cars. 
При покупке у дилера установлены оригинальные:
- защита картера и редуктора;
- комплект ковров резиновых + тканевые;
- дефлекторы на стекла;
- защитные трубы по кругу (нержавейка);
- декоративные решетки из нержавейки;
- сигнализация PANDORA с GSM- модулем и управлением с телефона;
- кожаная оплетка руля;
- видеорегистратор (скрытая проводка).

Имеется комплект зимних колес на оригинальных дисках.

Автомобиль прошел "Большое" ТО-60000 на станции SUBARU:
- замена жидкости в АКПП;
- замена жидкости в редукторе;
- замена тормозной жидкости;
- замена антифриза;
- замена масла в двигателе;
- замена всех фильтров;
- замена тормозных дисков и колодок.
